import React from 'react';
import classes from './Exercises.module.css';
import data from '../data/Equinox_FE_exercises.json';

function Exercises() {
  const clickHandler = (e) => {
    console.log(e.target);
  };

  return (
    <>
    <div className={classes['left-pane']}>
    <div>
    <h1>Search Bar</h1>
    </div>
    <div>
    <h1>Exercises</h1>
      {data.map((exercise) => (
        <Link to={`/details/${exercise.id}`} key={exercise.id}>
        <div className={classes.exercise} key={exercise.id} onClick={clickHandler}>
          <h2>{exercise.name}</h2>
         </div>
          </Link>
      ))}
    </div>
    </div>
    </>
  )
}

export default Exercises
